import React from 'react'
import './Login.css';
function Login() {
  return (
    <div className='loginpage'>
        <div className='login-content'>
            <form></form>
            <h1>Login</h1>
            <input type='text' placeholder='email' />
            <input type='password' placeholder='password' />

        </div>
    </div>
  )
}

export default Login
